/**
 * Default route
 */
app.get("/", (req, res) => {
    res.setHeader("Content-Type", "text/html; charset=utf-8");
    res.send(HTML_PAGE);
});

/**
 * Update HTML dynamically
 */
app.use(express.json());
app.post("/set-html", (req, res) => {
    if (typeof req.body.html !== "string") {
        return res.status(400).json({ error: "html must be string" });
    }
    HTML_PAGE = req.body.html;
    res.json({ status: "HTML updated" });
});

/**
 * Health check (used for ping)
 */
app.get("/ping", (req, res) => {
    res.send("pong");
});

/**
 * 🔁 AUTO PING SELF
 * Ping every 5 minutes
 */
if (SERVICE_URL) {
    setInterval(() => {
        https.get(`${SERVICE_URL}/ping`, (res) => {
            console.log(`[AutoPing] Status: ${res.statusCode}`);
        }).on("error", (err) => {
            console.error("[AutoPing] Error:", err.message);
        });
    }, 5 * 60 * 1000); // 5 minutes
}

app.listen(PORT, () => {
    console.log("Server running on port", PORT);
    console.log("Service URL:", SERVICE_URL);
});
